import React from "react"
import NINE from "../nl_logo.png";
import {BrowserRouter,Link} from "react-router-dom";


class Empheader extends React.Component {

    render() {
        function onItemClick(){
            window.location=""
        }
        return (
            <BrowserRouter>
            <header>
                <div>
                    <nav>
                        <div >
                        <Link onClick={this.onItemClick} > <img style={{float:"left"}}  src={NINE} alt="nineleaps"/> </Link>
                           <Link to = "/logout" style={{float:"right"}} >Logout</Link>
                        </div>

                    </nav>

                </div>
            </header>
            </BrowserRouter>

        )
    }
}
export default Empheader
